import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import { withStyles } from "@material-ui/core/styles";

const styles = theme => ({
  button: {
    backgroundColor: "#e040fb"
  }
});

class ContactResult extends Component {
  render() {
    const { classes } = this.props;

    let button;
    if (this.props.onReset) {
      button = (
        <Button
          className={classes.button}
          variant="contained"
          color="secondary"
          type="submit"
          onClick={this.props.onReset}
        >
          Go Back!
        </Button>
      );
    }
    return (
      <div style={{ textAlign: "center", position: "relative", bottom: 50 }}>
        <h1 style={{ paddingTop: 100, textAlign: "center", color: "#d8dcf2" }}>
          Contact
        </h1>
        <img src={this.props.image} alt="dogs" style={{ height: 400 }} />
        <h3 style={{ color: "#d8dcf2" }}>{this.props.title}</h3>
        <p style={{ color: "#d8dcf2" }}>{this.props.content}</p>
        {button}
      </div>
    );
  }
}

export default withStyles(styles)(ContactResult);
